import "./index.css"; // Assurez-vous de remplacer "DetailsTerrain.css" par le nom de votre fichier CSS

const DetailsTerrain = () => {
  return (
    <>
        <div className="greet" >
        <div className="title">Terrains à valider</div>
        <div className="subtitle">validez la création de vos terrain</div>
        </div>

        <button className="details-terrain-button">
        <div className="background-terrain"></div>
        <div className="arrow-terrain"></div>
        </button>
    </>
  );
};

export default DetailsTerrain;
